import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import { BrowserRouter } from "react-router-dom";
import { loadStripe } from "@stripe/stripe-js";
import { StripeProvider, Elements } from "@stripe/react-stripe-js";
const stripePromise = loadStripe(
  "pk_live_51OR8kiSIm5G6fCOHDjlmxpsPuTlojur8gyaQZxaZZbwDNXwEljzSfqHNXjhVzyyDGaJ3eEfPlvcrTt9x5xYUVxy000qsIE7HRP"
);
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <BrowserRouter>
    <React.StrictMode>
      <StripeProvider stripe={stripePromise}>
        <Elements>
          <App />
        </Elements>
      </StripeProvider>
    </React.StrictMode>
  </BrowserRouter>
);
